import styled from '@emotion/styled'

const Container = styled.div`
  background-color: white;
  width: 90%;
  margin: 2rem auto;
  padding: 2rem;
`

const CartContainer = styled.div`
  display: grid;
  grid-template-columns: 4fr 1fr 1fr 1fr;
`

export const ShoppingCart = () => {
  return (
    <Container>
      <h2>รถเข็นสินค้า (2)</h2>
      <CartContainer>
        <div>สินค้า</div>
        <div>ราคา</div>
        <div>ปริมาณ</div>
        <div>ราคารวม</div>
      </CartContainer>
    </Container>
  )
}
